import base64

import cv2
import numpy as np
import requests

photo = ""






nparr = np.frombuffer(base64.b64decode(photo), np.uint8)
img = cv2.imdecode(nparr, cv2.IMREAD_ANYCOLOR)
#cv2.imshow("", img)
#key = cv2.waitKey(0)
image = cv2.imencode('.jpg', img)[1].tobytes()
base64img = base64.b64encode(image)
print(base64img)




url = 'http://localhost:8000/update_photo'  # camera_streams/'
# url = 'http://jerboaworkshop.com/Videostreaming/CameraRecording'
